import React from "react"

import  './MainPage.css'
import { UserInfo, Menu, Header, Main, AboutProdukts } from '../components'

function MainPage({ items }) {
    console.log(items)
    return (
        <div className="main-block">
            <div className="left-block">
                <UserInfo />
                <Menu
                onChange = {(name) => alert(name)}
                items = {
                  [
                    'О продуктах'
                  ]
                  } />
            </div>
            <div className="right-block">
                {
                    items
                }
                <Header />
                <AboutProdukts />
                <Main />
            </div>
        </div>
    )
}

export default MainPage
